import React from 'react';
import Logo from "../logo.png";
import "../css/footer.css";
const Footer = () => {
    return ( 
        <div className="footer">
          <div className="f-linkovi">
            <ul>
              <li>About Us</li>
              <li>Contact</li>
              <li>Galery</li>
            </ul>
            </div>    
          <div className="f-Logo">
          <img src={Logo} />    
          </div>    
          <div className="f-f-awsome">
          <a href="https://www.linkedin.com/school/brainster-co/"><i class="fa fa-linkedin" aria-hidden="true"></i></a>
         <a href="https://twitter.com/BrainsterCo"> <i class="fa fa-twitter" aria-hidden="true"></i></a>
          <a href="https://www.facebook.com/brainster.co"><i class="fa fa-facebook" aria-hidden="true"></i> </a>   
          </div>    
        </div>
     );
}
 
export default Footer;
